        return (
            <div className='notification-view-container'>
                <img
                    src={require('../../../ressources/profil_test.png')}
                    className='notification-view-image' />
                <div className='notification-view-content'>
                    <div>
                        Ben Kabongo a aim√© votre nouvelle photo
                    </div>
                </div>
            </div>
        );
    }
}
